
CREATE TABLE `CaSi`(
	`CaSiID` varchar(10) NOT NULL UNIQUE,
	`TenCaSi` NVARCHAR(50),
	`Thumbnail` varchar(500),
	`Cover` varchar(500),
	PRIMARY KEY(`CaSiID`)
);

CREATE TABLE `BaiHat`(
	`BaiHatID` varchar(10) NOT NULL UNIQUE,
	`TenBaiHat` NVARCHAR (100),
	`Thumbnail` varchar(500),
	`Lyric` varchar(500),
	`LuotNghe` INT,
	PRIMARY KEY(`BaiHatID`)
);

CREATE TABLE `TheLoai`(
	`TheLoaiID` varchar(10) NOT NULL UNIQUE,
	`TenTheLoai` nvarchar(20),
	PRIMARY KEY(`TheLoaiID`)
);

CREATE TABLE `TheLoaiBaiHat`(
	`TheLoaiID` varchar(10),
	`BaiHatID` varchar(10),
	FOREIGN KEY(`BaiHatID`) REFERENCES `BaiHat`(`BaiHatID`),
	FOREIGN KEY(`TheLoaiID`) REFERENCES `TheLoai`(`TheLoaiID`)
);

CREATE TABLE `CaSiHatBaiHat`(
	`BaiHatID` varchar(10) NOT NULL,
	`CaSiID` varchar(10) NOT NULL,
	FOREIGN KEY(`BaiHatID`) REFERENCES `BaiHat`(`BaiHatID`),
	FOREIGN KEY(`CaSiID`) REFERENCES `CaSi`(`CaSiID`)
);

CREATE TABLE `KhachHang`(
	`UserID` varchar(20) NOT NULL UNIQUE,
	`Pass` varchar(50) NOT NULL,
	`TenUser` nvarchar(50),
	`Email` varchar(50),
	PRIMARY KEY(`UserID`)
);

CREATE TABLE `Playlist`(
	`PlaylistID` varchar(10) NOT NULL UNIQUE,
	`PlaylistName` nvarchar(50),
	`Thumbnail` varchar(500),
	PRIMARY KEY(`PlaylistID`)
);

CREATE TABLE `UserPlaylist`(
	`UserID` varchar(20),
	`PlaylistID` varchar(10) UNIQUE,
	FOREIGN KEY(`UserID`) REFERENCES `KhachHang`(`UserID`),
	FOREIGN KEY(`PlaylistID`) REFERENCES `Playlist`(`PlaylistID`)
);

CREATE TABLE `PlaylistBaiHat`(
	`PlaylistID` varchar(10),
	`BaiHatID` varchar(10),
	FOREIGN KEY(`BaiHatID`) REFERENCES `BaiHat`(`BaiHatID`),
	FOREIGN KEY(`PlaylistID`) REFERENCES `Playlist`(`PlaylistID`)
);

CREATE TABLE `Favorite`(
	`UserID` varchar(20),
	`BaiHatID` varchar(10),
	FOREIGN KEY(`UserID`) REFERENCES `KhachHang`(`UserID`),
	FOREIGN KEY(`BaiHatID`) REFERENCES `BaiHat`(`BaiHatID`)
);

